<meta charset="utf-8">

<script>

numeroInicial = 30;

while (numeroInicial <= 40){

	if(numeroInicial == 33) {

		numeroInicial = numeroInicial +1;
	}

	if(numeroInicial == 37 ){
		numeroInicial = numeroInicial + 1;
	}

	else {

		document.write(numeroInicial + "<br>")
		numeroInicial = numeroInicial + 1;
	}



}


</script>
